/* eslint-disable no-undef */
import React from 'react';

const Tweet = ({tweets}) => (

    <>
        <div> 
            {tweets.map((thistweet, key) => 
            <div className="tweet" key={key}>
                <p>{thistweet.user.name}</p>
                <p>{thistweet.user.screen_name}</p>
                <img src={thistweet.user.profile_image_url} alt="not found"/>
                <p>{thistweet.created_at}</p>
                <p>{thistweet.text}</p> 
                <p>{thistweet.source}</p>
                <p>{thistweet.reply_count} replies and {thistweet.retweet_count} retweets</p>
                
            </div>
            )}
        </div> 
    </>
)



export default Tweet;
